import React, { useEffect, useState } from 'react';
import { searchProperties, getAllProperties, getPropertyEnums } from '../api/propertyService';
import PropertyCard from '../components/PropertyCard';

const CatalogPage = () => {
    const [properties, setProperties] = useState([]);
    const [propertyTypes, setPropertyTypes] = useState([]);
    const [filters, setFilters] = useState({
        city: '',
        minRooms: '',
        maxRooms: '',
        minPrice: '',
        maxPrice: '',
        propertyType: ''
    });
    const [loading, setLoading] = useState({
        properties: false,
        enums: false
    });
    const [error, setError] = useState(null);

    // Загрузка всех объектов и enum'ов при монтировании
    useEffect(() => {
        const loadInitialData = async () => {
            try {
                setLoading(prev => ({ ...prev, enums: true }));
                const [propertiesData, enumsData] = await Promise.all([
                    getAllProperties(),
                    getPropertyEnums()
                ]);
                setProperties(propertiesData);
                setPropertyTypes(enumsData.propertyTypes || []);
            } catch (err) {
                console.error(err);
                setError('Ошибка при загрузке данных');
            } finally {
                setLoading(prev => ({ ...prev, enums: false }));
            }
        };

        loadInitialData();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFilters(prev => ({ ...prev, [name]: value }));
    };

    const handleSearch = async () => {
        setLoading(prev => ({ ...prev, properties: true }));
        setError(null);
        try {
            const nonEmptyParams = Object.fromEntries(
                Object.entries(filters).filter(([_, value]) => value !== '')
            );

            const data = Object.keys(nonEmptyParams).length > 0
                ? await searchProperties(nonEmptyParams)
                : await getAllProperties();

            setProperties(data);
        } catch (err) {
            console.error(err);
            setError('Ошибка при поиске');
        } finally {
            setLoading(prev => ({ ...prev, properties: false }));
        }
    };

    const resetFilters = () => {
        setFilters({
            city: '',
            minRooms: '',
            maxRooms: '',
            minPrice: '',
            maxPrice: '',
            propertyType: ''
        });
        handleSearch(); // Используем существующую логику поиска
    };

    return (
        <div className="page-container">
            <h1>Каталог</h1>

            {/* Форма фильтрации */}
            <div className="filter-form">
                <input type="text" name="city" placeholder="Город"
                       value={filters.city} onChange={handleChange} />
                <input type="number" name="minRooms" placeholder="Мин. комнат"
                       value={filters.minRooms} onChange={handleChange} />
                <input type="number" name="maxRooms" placeholder="Макс. комнат"
                       value={filters.maxRooms} onChange={handleChange} />
                <input type="number" name="minPrice" placeholder="Мин. цена"
                       value={filters.minPrice} onChange={handleChange} />
                <input type="number" name="maxPrice" placeholder="Макс. цена"
                       value={filters.maxPrice} onChange={handleChange} />

                <select
                    name="propertyType"
                    value={filters.propertyType}
                    onChange={handleChange}
                    disabled={loading.enums}
                >
                    <option value="">Тип недвижимости</option>
                    {propertyTypes.map(type => (
                        <option key={type.value} value={type.value}>
                            {type.label}
                        </option>
                    ))}
                </select>

                <div className="filter-buttons">
                    <button
                        onClick={handleSearch}
                        disabled={loading.properties}
                    >
                        {loading.properties ? 'Поиск...' : 'Поиск'}
                    </button>
                    <button
                        onClick={resetFilters}
                        className="reset-button"
                        disabled={loading.properties}
                    >
                        Сбросить
                    </button>
                </div>
            </div>

            {/* Состояния загрузки и ошибки */}
            {loading.enums && <p>Загрузка типов недвижимости...</p>}
            {error && <p className="error">{error}</p>}

            {/* Результаты */}
            {loading.properties ? (
                <p>Загрузка объектов...</p>
            ) : properties.length === 0 ? (
                <p>Объекты недвижимости не найдены</p>
            ) : (
                <div className="property-list">
                    {properties.map(property => (
                        <PropertyCard key={property.id} property={property} />
                    ))}
                </div>
            )}
        </div>
    );
};

export default CatalogPage;
